                <strong>Modulo: { activeModule.title }</strong>
            </div>
            <div>
                <strong>Aula: { activeLesson.title }</strong>
            </div>
        </>

    )
}

export default connect(state => ({
    activeModule: state.course.activeModule,
    activeLesson: state.course.activeLesson,
}))(Video)
